import React from 'react';
import logo from './logo.svg';
import './App.css';
import HomeBody from './homepage';
import MovieList from './movies';

function Nav() {
  return (
    <div className="row">
      <img className="col-1" src="./4746048.png" />
      <div className="col-11">
        <h1> Joel Hilton Movie Site</h1>
        <p>
          <span className="link" onClick={home} style={{ margin: '5px' }}>
            Home
          </span>{' '}
          <span onClick={home} style={{ margin: '5px' }}>
            My Podcast
          </span>{' '}
          <span onClick={home} style={{ margin: '5px' }}>
            Movie List
          </span>
        </p>
      </div>
    </div>
  );
}

function home() {
  alert('Great Shot!');
}

function App() {
  return (
    <div>
      <Nav />
      <HomeBody />
      <MovieList />
    </div>
  );
}

export default App;
